import Friday from "./mini_components/Friday";
import Monday from "./mini_components/Monday";
import Saturday from "./mini_components/Saturday";
import Thursday from "./mini_components/Thursday";
import Tuesday from "./mini_components/Tuesday";
import Wednesday from "./mini_components/Wednesday";


const Schedule = () =>
{

    return (
        <div>
            <h1 style={{textAlign: 'center'}}>Расписание</h1>
            <Monday />
            <Tuesday />
            <Wednesday />
            <Thursday />
            <Friday />
            <Saturday />
        </div>
        
    )
}

export default Schedule;
